import React from 'react';

export default function Home() {
  return (
    <section>
      <h2 className="text-3xl font-semibold mb-4">Bem-vindo à Better Assesoria</h2>
      <p className="text-gray-700">Conheça nossos serviços de consultoria e gestão em obras, com foco em eficiência e qualidade.</p>
    </section>
  );
}
